tables.table_schema:
CREATE TABLE users (
    user_id INT PRIMARY KEY,
    username TEXT,
    email TEXT
);

CREATE TABLE workouts (
    workout_id INT PRIMARY KEY,
    workout_name TEXT,
    workout_description TEXT,
    average_duration INT
);

CREATE TABLE exercises (
    exercise_id INT PRIMARY KEY,
    exercise_name TEXT,
    muscle_group TEXT,
    intensity_level TEXT
);
